import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import { MAIN_ROUTE, POLLS_ROUTE, NEWS_ROUTE, CONTACTS_ROUTE, INFORMATION_ROUTE } from '../../const';
import logo from '../../img/logo-main.png';
import './Header.css';
import Modal from '../ModalReserve/Modal';
import ModalOrder from '../ModalOrder/ModalOrder';

const Header = () => {

    const [modalActive, setModalActive] = useState(false)
    const [modalOrderActive, setModalOrderActive] = useState(false)

    return (
        <div>
            <header>
                <div className="menu-container">
                    <ul className='menu'>
                        <li><NavLink to={MAIN_ROUTE}>
                            <img className="header-item" src={logo} alt="" />
                        </NavLink></li>
                        <li><NavLink to={POLLS_ROUTE}>Опросы</NavLink></li>
                        <li><NavLink to={NEWS_ROUTE}>Публикации</NavLink></li>
                        <li><NavLink to={CONTACTS_ROUTE}>Контакты</NavLink></li>
                        <li><NavLink to={INFORMATION_ROUTE}>Информация</NavLink></li>
                    </ul>
                    <Modal active={modalActive} setActive={setModalActive} />
                    <ModalOrder active={modalOrderActive} setActive={setModalOrderActive} />
                </div>
            </header>
        </div>
    );
};

export default Header;
